import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: `
  <main>
    <img class="header" src="/assets/trolltunga2.png" alt="ono where image" aria-hidden="true">
    <img class="test" src="/assets/pasta.png" alt="ono where image" aria-hidden="true">Harlo</img>
  </main>  
  `,
  //templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'portfolio';
}
